script: |
  super -f text -I q9529.spq | sort > q9529.out

inputs:
  - name: q9529.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + - 10 NOT BETWEEN + col2 - col1 AND + ( + + col0 ) * + col1 + - col2;
  - name: tab1

outputs:
  - name: q9529.out
    data: |
      51	14	96
      85	5	59
      91	47	68
